import React, { useState, useEffect } from 'react'

const Table = (props) =>  {
    const { bands } = props;

        
    let sortedProducts = [...bands];
    sortedProducts.sort((a, b) => {
      if (a.name < b.name) {
        return -1;
      }
      if (a.name > b.name) {
        return 1;
      }
      return 0;
    });


    return (
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          {bands.map(band => (
            <tr key={band.id}>
              <td>{band.name}</td>
              <td>{band.price}</td>
              <td>{band.stock}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
  

  export default Table
